	add("angiosperm", "{\"term\":\"angiosperm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027·ºÄŒ≥Œ≥Œµ·øñŒøŒΩ\u0027 (receptacle) + \u0027œÉœÄŒ≠œÅŒºŒ±\u0027 (seed)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant of the clade Angiosperms, characterized by having ovules enclosed in an ovary; a flowering plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"As with the Lejeuneaceae, this pattern of massive speciation appears to be correlated with the Cretaceous explosion of the \u0027\u0027angiosperms\u0027\u0027 and the simultaneous creation of a host of new microenvironments, differing in humidity, light intensity, texture, etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Valentin A. Krassilov, \u0027Angiosperm Origins: Morphological and Ecological Aspects\u0027, [http://books.google.com.au/books?id\u003dlXzlpRw_y38C\u0026amp;pg\u003dPA134\u0026amp;dq\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddt39UuSEBMSVkwXUsICgCQ\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;f\u003dfalse page 134\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The notion of magnoliaceans as the most primitive living \u0027\u0027angiosperms\u0027\u0027, justified or not, does not mean that all their characters, including multilacunar nodal anatomy and the lack of tannins, are primary\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Xin Wang, \u00273: New Fossils and New Hope for the Origin of Angiosperms\u0027, Pierre Pontarotti, \u0027Evolutionary Biology: Concept, Modeling, and Application\u0027, [http://books.google.com.au/books?id\u003dvl2COz8Sq1EC\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddt39UuSEBMSVkwXUsICgCQ\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;f\u003dfalse page 55\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"With all these features, it is pretty easy for one to identify an \u0027\u0027angiosperm\u0027\u0027. This is a very normal and common practice for neobotanists. However, the situation becomes complicated when you go back to the early history of \u0027\u0027angiosperms\", \"priority\":8}]}, \"synonyms\":{}}");

	add("angiotensin", "{\"term\":\"angiotensin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|angio|tensin|alt2\u003d(hyper)tensin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several polypeptides that narrow blood vessels and thus regulate arterial pressure\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027: In addition to stimulating the srteries to constrict, \u0027\u0027angiotensin\u0027\u0027 also acts on the kidneys to suppress urine production, and acts on the brain to stimulate thirst and drinking behaviour. ‚Äî Leslie Iversen, \u0027Drugs: A Very Short Introduction\u0027 (Oxford 2001, p. 43\", \"priority\":2}]}, \"synonyms\":{}}");

