	add("anglo", "{\"term\":\"anglo\", \"etymology\":{\"influencers\":[], \"languages\":[\"Latin\", \"Portuguese\"], \"text\":\"From Latin {{m|la|Anglii}}. See {{m|en|Angle}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An English person or person of English ancestr\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the United States, an American, especially a White American, whose native language is English. The term generally is used in contrast to Americans for whom Spanish is their native language, or people whose ancestry is from Latin America. The term is used without regard to English descent. It is likely derived as a reference to English (rather than Spanish) as a native languag\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A white-skinned person\", \"priority\":3}]}, \"synonyms\":{}}");

