	add("angst", "{\"term\":\"angst\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"German\", \"English\", \"middle high german (ca. 1050-1500)\", \"old high german (ca. 750-1050)\", \"Dutch\", \"Swedish\"], \"text\":\"From the German word \u0027angst\u0027 or the Danish word \u0027angst\u0027 attested since the 19th century in English translations of the works of Freud and {{w|S√∏ren Kierkegaard}}. ({{w|George Eliot}} used the phrase complete with definite article: \u0026quot;{{lang|de|die Angst}}\u0026quot;.) Initially capitalized (as in German and contemporaneous Danish), the term first began to be written with a lowercase \u0026quot;a\u0026quot; around 1940‚Äì44.\u0026lt;ref\u0026gt;{{R:Merriam Webster Online|angst}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:Dictionary.com|angst}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?search\u003dangst\u0026amp;searchmode\u003dnone Online Etymology Dictionary, \u0026quot;angst\u0026quot;]\u0026lt;/ref\u0026gt; The German and Danish terms both derive from Middle high german (ca. 1050-1500) \u0027angest\u0027 from Old high german (ca. 750-1050) \u0027angust\u0027 from Proto-germanic {{m|gem-pro|*angustiz}}; Dutch \u0027angst\u0027 is cognate. Compare Swedish \u0027lang\u003dsv\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Emotional turmoil; painful sadness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Peter Hammill, \u0027Mirror images\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ve begun to regret that we\u0027d ever met / Between the dimensions. / It gets such a strain to pretend that the change / Is anything but cheap. / With your infant pique and your \u0027\u0027angst\u0027\u0027 pretensions / Sometimes you act like such a creep\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Martyn Bone, \u0027Perspectives on Barry Hannah\u0027 (page 3\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Harry\u0027s adolescence is theatrical and gaudy, and many of its key scenes have a lurid and camp quality that is appropriate to the exaggerated mood-shifting and self-dramatizing of teen \u0027\u0027angst\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A feeling of acute but vague anxiety or apprehension often accompanied by depression, especially philosophical anxiety\", \"priority\":6}]}, \"synonyms\":{}}");

