	add("angus", "{\"term\":\"angus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Scottish Gaelic\"], \"text\":\"Anglicized form of Scottish gaelic \u0027aonghas\u0027 perhaps literally \u0026quot;one choice\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of mostly Scottish usage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027 w:Robertson RobertsonDavies, \u0027The Cunning Man\u0027, Viking 1995, ISBN 0670859117, page 168\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Angus\u0027\u0027 was a great enlargement of experience for me, because he illustrated how haphazardly Fate attributes names to her unoffending children. \u0027\u0027Angus\u0027\u0027 McGubbin: a Scots giant, red-haired and scowling - wouldn\u0027t you think so\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A county in Scotland\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A black, hornless breed of beef cattle, originally from Scotland\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A nickname for the 0-8-8-0 train configuration\", \"priority\":6}]}, \"synonyms\":{}}");

